import React from 'react';
import monstera from "../images/plants/monstera.png";
import dragon from "../images/plants/dplant1.png";
import pearl from "../images/plants/pearlstrings.png";
import oak from "../images/plants/image 5.png";
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';




const Cart_product = () => {
    const history = useNavigate();
    const [isFavorite, setIsFavorite] = useState(true); // State to track if it's a favorite
    function removeFromFavorites() {
        setIsFavorite(false); // Update isFavorite state to false
      }

    if (!isFavorite) {
        return null; // If not a favorite, render nothing (it will disappear)
    } 

    function buy() {
        history('/buy');
      }


    return(
        <div style={{ display: "grid", gridTemplateColumns: "repeat(4, 1fr)", gap: "1rem" ,padding:'10px'}}>
            <div className = 'product_wrapper' >
                <div>
                    <div className= 'product_text' style={{border: '2px solid green', borderRadius: '10px', padding: "1rem" , backgroundColor: 'rgba(107, 142, 35, 0.3)' }}>
                        <img src={monstera} alt={monstera} />
                        <div className = 'product_text' style={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Name: Monstera</div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Sold by: Maria Florista</div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Price:</div>

                        <label htmlFor="minPrice">Quantity:</label>
      			        <input type="number" id="minPrice" placeholder="Quantity" style={{ padding: '5px', width: '100px' ,marginTop:'20px'}} />
                        <button style={{ marginRight: '100px', backgroundColor: '#ff6666', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop:'20px' } } >Remove</button>
                    </div>
                </div>

            </div>

            <div className = 'product_wrapper' >
                <div className= 'product_text' style={{border: '2px solid green', borderRadius: '10px', padding: "1rem" , backgroundColor: 'rgba(107, 142, 35, 0.3)' }}>
                        <img src={dragon} alt={dragon} style={{ width: 'auto', height: '100%', objectFit: 'cover' }} />
                        <div className = 'product_text' style={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Name: Dragon PLant</div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Sold by: Maria Florista</div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Price:</div>
                        <label htmlFor="minPrice">Quantity:</label>
      			        <input type="number" id="minPrice" placeholder="Quantity" style={{ padding: '5px', width: '100px' ,marginTop:'20px'}} />
                        <button style={{ marginRight: '100px', backgroundColor: '#ff6666', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop:'20px' } }onClick={removeFromFavorites} >Remove</button>
                    </div>

            </div>

            <div className="product_wrapper">
            <div className="product_text" style={{ border: '2px solid green', borderRadius: '10px', padding: '1rem', backgroundColor: 'rgba(107, 142, 35, 0.3)', display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '1rem' }}>
                <img src={pearl} alt={pearl} style={{ width: 'auto', height: '100%', objectFit: 'cover', gridColumn: '1 / 2', gridRow: '1 / 4' }} />
                <div className="product_text" style={{ fontStyle: 'italic', marginBottom: '0.5rem', gridColumn: '2 / 4' }}>Name: Pearl of strings</div>
                <div className="product_text" style={{ fontStyle: 'italic', marginBottom: '0.5rem', gridColumn: '2 / 4' }}>Sold by: Continente</div>
                <div className="product_text" style={{ fontStyle: 'italic', marginBottom: '0.5rem', gridColumn: '2 / 4' }}>Price:</div>
                <label htmlFor="minPrice" style={{ gridColumn: '2 / 4' }}>Quantity:</label>
                <input type="number" id="minPrice" placeholder="Quantity" style={{ padding: '5px', width: '100px', marginTop: '20px', gridColumn: '2 / 4' }} />
                <button style={{ backgroundColor: '#ff6666', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop: '20px', gridColumn: '2 / 4' }}>Remove</button>
            </div>
            </div>

            <div className = 'product_wrapper' >
                <div className= 'product_text' style={{border: '2px solid green', borderRadius: '10px', padding: "1rem" , backgroundColor: 'rgba(107, 142, 35, 0.3)' }}>
                        <img src={oak} alt={oak} style={{ width: 'auto', height: '100%', objectFit: 'cover' }} />
                        <div className = 'product_text' style={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Name: Oak tree</div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Sold by: Jos√© Fernandes </div>
                        <div className = 'product_text'tyle={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Price:</div>

                        <label htmlFor="minPrice">Quantity:</label>
      			        <input type="number" id="minPrice" placeholder="Quantity" style={{ padding: '5px', width: '100px' ,marginTop:'20px'}} />
                        <button style={{ marginRight: '100px', backgroundColor: '#ff6666', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer', marginTop:'20px' } } >Remove</button>
                    </div>

            </div>
            </div> 

        );
};

export default Cart_product;
